<html>

<head>

    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">

    <style>
        /*global*/

        * {
            border: 0;
            margin: 0;
            padding: 0;
            transition: all 0.001s;
            box-sizing: border-box
        }

        html,
        body {
            height: 100%;
            overflow: hidden;
        }

        body {
            font-family: "Open Sans", '思源黑体', '思源宋体', sans-serif;
            line-height: 1.42857143;
            background-size: cover;
            background: #eee;
        }

        div {
            user-select: none;
        }

        body>div#model {
            width: 100%;
            height: 100%;
        }

        h1,
        h2,
        h3,
        h4,
        h5,
        h6,
        p,
        label,
        ul,
        input {
            margin: 0;
        }

        ul,
        ol {
            list-style-type: none;
            padding: 0;
        }

        :focus,
        a,
        a:active,
        a:focus,
        a:hover,
        button,
        button:focus {
            outline: 0;
        }

        button[disabled] {
            cursor: default;
            background-color: #aaa;
        }

        .comps {
            background-color: #fff;
        }

        .box-shadow {
            box-shadow: 0 1px 5px 0 rgba(85, 85, 85, 0.15);
        }

        .srch-ipt {
            display: inline-block;
            width: 70%;
            height: 32px;
            border: 1px solid #42A5DB;
            box-shadow: 0 0 2px #42A5DB;
            vertical-align: top;
            padding: 10px;
        }

        .srch-ipt+input[type='button'] {
            width: 50px;
            height: 32px;
            background-color: #42A5DB;
            color: #fff;
            box-shadow: 0 0 2px #42A5DB;
        }

        em {
            display: inline-block;
            width: 0;
            height: 0;
            border-width: 7px;
            border-style: solid;
            overflow: hidden;
            font-size: 0;
            line-height: 0;
            vertical-align: top;
            transition: all 0s;
        }

        input:disabled {
            background: #ccc
        }

        input:disabled:hover {
            background: #ccc
        }

        .filter {
            position: absolute;
            width: 100%;
            height: 100%;
            background: #000;
            opacity: 0.8;
        }

        .filter.light {
            opacity: 0.5;
        }

        /*new 3D model page*/

        .menu {
            width: 100%;
            height: 100%;
        }

        .ZwViewerStudio {
            width: 100%;
            height: 100%;
        }

        .slider {
            display: inline-block;
            width: 300px;
            height: calc(100% - 125px);
            z-index: 10;
            overflow-y: auto;
            border-width: 2px;
            position: absolute;
            left: 0px;
            border-top: 0 none;
            transition: left 0.2s;
            margin-top: 100px;
        }

        .slider.hide {
            left: -400px;
        }

        .sli-tgl-box,
        .setting-panel {
            position: absolute;
            padding: 8px;
            padding-top: 53px;
            z-index: 1;
        }

        .setting-panel {
            bottom: 0px;
            right: 0px;
            z-index: auto;
        }

        .setting-panel:hover {
            cursor: pointer;
        }

        div.tab-bar {
            text-align: center;
            position: relative;
            z-index: 999;
        }

        div.tab-bar a.bar-item {
            height: 36px;
            line-height: 36px;
            padding: 10px 10px 5px;
            font-size: 16px;
            font-weight: bold;
            color: #ccc;
        }

        div.tab-bar a.bar-item:hover {
            border-bottom: 2px solid #ccc;
        }

        div.tab-bar a.bar-item.active {
            color: #333;
            border-bottom: 2px solid #333;
        }

        .desc-list {
            position: absolute;
            height: 100%;
            min-width: 100%;
            top: 0;
        }

        .dialog-viewer {
            position: fixed;
            left: 350px;
            z-index: 20;
        }

        .editor {
            width: 100%;
            height: 100%;
            position: relative;
            display: inline-block;
            transition: width 0.2s;
        }

        .editor.full-screen {
            width: 100%;
        }

        .comptree {
            height: 100%;
            background-color: rgba(255, 255, 255);
        }

        .comps {
            background-color: rgba(255, 255, 255);
        }

        li.active>span.tree-icon {
            transform: rotate(90deg);
        }

        li+ul.children-node {
            display: none;
        }

        li.active+ul.children-node {
            display: block;
        }

        .ZwViewer {
            height: 100%;
            width: 100%
        }

        .ZwViewCube {
            position: absolute;
            top: 0;
            right: 0;
            width: 120px;
            height: 120px;
        }

        .loading-state {
            position: absolute;
            top: 0;
            left: 0;
            z-index: 101;
        }

        .cadbr-diag {
            position: absolute;
            text-align: center;
            width: 300px;
            top: 50%;
            left: 50%;
            margin-left: -150px;
        }

        .loading-per {
            width: 100%;
            height: 5px;
            background-color: #42A5DB;
        }

        .children-node li {
            height: 36px;
            line-height: 36px;
            color: #333;
            white-space: nowrap;
            background-color: rgba(255, 255, 255, 0.5);
            width: 100%;
        }

        .children-node li span {
            vertical-align: middle;
            cursor: pointer;
        }

        .children-node li span:hover {
            font-weight: bold;
        }

        .children-node li span.uncursor {
            pointer-events: none;
            cursor: default;
        }

        .children-node li span.uncursor:hover {
            font-weight: normal
        }

        .reward-diag {
            width: 450px;
            margin: -134px auto;
        }

        .rew-coin {
            margin: 10px 0;
        }

        .rew-coin>span {
            color: #666;
            font-size: 24px;
        }

        .rew-btn {
            background-color: #ff9630;
            color: #fff;
            width: 80px;
            padding: 5px;
            border-radius: 5px;
            text-align: center;
        }

        .diag-thumb {
            height: 70px;
            width: 70px;
            border-radius: 50%;
            background: #eee;
            background-repeat: no-repeat;
            background-position: center;
            background-size: cover;
            border: 2px solid #eee;
            margin: 10px auto;
        }

        /* .tree-icon.expanded {
    transform: rotate(90deg);
} */

        input[type=checkbox] {
            height: 20px;
            width: 20px;
            line-height: 36px;
            vertical-align: middle
        }

        .tree-icon {
            cursor: pointer;
            width: 0;
            height: 0;
            margin-left: 10px;
            margin-right: 8px;
            border: 8px solid transparent;
            border-right-width: 0;
            border-left-color: #333;
            border-left-width: 10px;
            -ms-transform: rotate(0);
            transform: rotate(0);
            transition: transform .3s ease-in-out;
            display: inline-block;
            vertical-align: middle;
        }

        .tree-icon.is-leaf {
            border-color: transparent;
            cursor: default;
        }

        #operation {
            position: absolute;
            margin-left: 50%;
            bottom: 10px;
        }

        #operation.disabled {
            cursor: not-allowed;
            pointer-events: none
        }



        @media screen and (max-width:768px) {
            .set-right {
                width: 100%
            }


            .editor {
                width: 100%;
            }

            .setpage-bg>.mdls-container>.mdl-container>.set-container>.set-left {
                position: fixed;
                top: 50%;
                left: -128px;
                margin-top: -130px;
                z-index: 6;
                box-shadow: 2px 2px 2px rgba(0, 0, 0, .1);
                transition: left 0.5s;
            }

            .setpage-bg>.mdls-container>.mdl-container>.set-container>.set-left.active {
                left: 0px;
            }

            .setpage-bg .act-basic table {
                width: 100%;
            }

            .noticepage-bg .set-left {
                position: fixed;
                top: 50%;
                left: -128px;
                margin-top: -130px;
                z-index: 6;
                box-shadow: 2px 2px 2px rgba(0, 0, 0, .1);
                transition: left 0.5s;
            }

            .noticepage-bg .set-left.active {
                left: 0;
            }

            .publish-diag {
                width: 300px;
            }

            .sm-diag {
                width: 370px;
            }
        }

        @-moz-keyframes rotate {
            0% {
                -moz-transform: rotate(0deg);
            }

            100% {
                -moz-transform: rotate(360deg);
            }
        }

        @-webkit-keyframes rotate {
            0% {
                -webkit-transform: rotate(0deg);
            }

            100% {
                -webkit-transform: rotate(360deg);
            }
        }

        @keyframes rotate {
            0% {
                transform: rotate(0deg);
            }

            100% {
                transform: rotate(360deg);
            }
        }

        /*operation button*/

        #menus {
            transform: translateX(-50%);
            opacity: 0.7;
            transition: opacity 0.1s;
        }

        /* #submenus {
    position: absolute;
    transform: translateX(-50%);
    top: 0;
} */

        #menus:hover {
            opacity: 1;
            background-color: #fff;
        }

        #menus>li {
            float: left;
        }

        #menus>li>a.oper {
            display: inline-block;
        }

        .oper {
            background-color: rgb(219, 219, 219);
        }

        @media screen and (min-width:1024px) {
            .oper:hover {
                background-color: #fff;
            }
        }

        .oper.active {
            background-color: #fff;
        }

        #menus>li.oper {
            box-shadow: 0 0px 0 1px rgba(66, 165, 219, 0.8);
        }

        #menus>li.oper:hover,
        #menus>li.oper.active {
            box-shadow: 0 0px 3px 3px rgba(66, 165, 219, 0.8);
            z-index: 1;
        }

        .oper-menu {
            position: absolute;
            z-index: 100;
            background-position: -166px -582px;
        }

        .oper-eyes {
            background-position: -83px 0px;
        }

        .oper-views {
            background-position: 84px -250px;
        }

        .oper-exp {
            background-position: -83px -331px;
        }

        .oper-sec {
            background-position: -167px -331px;
        }

        .oper-render {
            background-position: 0px -581px;
        }

        .oper-measure {
            background-position: -167px -830px;
        }

        .oper-info {
            background-position: 2px -664px;
        }

        .oper-camera {
            background-position: -247px 0px;
        }

        .oper-camera.active {
            background-position: 0px 0px;
        }

        .oper-unit {
            background-position: -247px -82px;
        }

        .oper-move {
            background-position: -247px -746px;
        }

        .oper-restore {
            background-position: -247px -664px;
        }

        .pause-icon {
            background-position: -164px 278px;
        }

        .play-icon {
            background-position: -164px 332px;
        }

        .stop-icon {
            background-position: -164px 220px;
        }

        .sliderTgl,
        .setting-icon {
            border: 0px;
            box-shadow: 0 0 0 #fff;
        }

        .sliderTgl:hover {
            color: #42A5DB;
        }

        .sliderTgl {
            background-position: -83px -664px;
        }

        .setting-icon {
            background-position: -167px -664px;
        }

        .menu-items {
            position: absolute;
            transform: scale(0);
            transition: 0.2s;
            transform-origin: 23px 23px;
            bottom: 0;
            background: #fff;
            box-shadow: 0 2px 5px 0 rgba(0, 0, 0, .16), 0 2px 10px 0 rgba(0, 0, 0, .12);
        }

        .menu-items.show {
            transform: scale(1);
        }

        .menu-items.m2 {
            height: 46px;
        }

        .menu-items.m8 {
            width: 100px;
            padding: 10px;
        }

        .menu-items.diag.m5d,
        .menu-items.diag.m6 {
            position: fixed;
            box-sizing: border-box;
            padding: 5px 10px;
            top: 0;
            right: 0;
            bottom: auto;
            width: 300px;
            background-color: #E2E6E9;
            border: 1px solid #BEC2C5;
            border-radius: 5px;
            box-shadow: 2px 2px 2px #aaaaaa;
            transform-origin: 100% 0;
            -ms-transform-origin: 100% 0;
            /* IE 9 */
            -webkit-transform-origin: 100% 0;
            /* Safari and Chrome */
            -moz-transform-origin: 100% 0;
            /* Firefox */
            -o-transform-origin: 100% 0;
            z-index: 1;
        }

        .menu-items.diag.m6 {
            width: 360px;
        }

        .menu-items.diag.m6 .type,
        .menu-items.diag.m6 .detail {
            border: 1px solid #9DA1A4;
            padding: 5px;
            margin-top: 15px;
            position: relative;
        }

        .menu-items.diag.m6 .type {
            height: 38px;
        }

        .menu-items.diag.m6 .detail {
            height: auto;
        }

        .menu-items.diag.m6 .detail .menu-title {
            position: absolute;
            top: -9px;
            left: 0px;
            background: #E2E6E9;
        }

        .menu-items.diag.m5d div,
        .menu-items.diag.m6 div {
            margin-top: 5px;
        }

        .menu-items.diag.m5d span,
        .menu-items.diag.m6 span {
            font-size: 12px;
            margin-left: 5px;
            vertical-align: middle;
        }

        .menu-items.diag.m5d img,
        .menu-items.diag.m6 img {
            vertical-align: middle;
        }

        .menu-items.diag.m5d input,
        .menu-items.diag.m6 input {
            margin-left: 10px;
            height: 20px;
            padding-left: 5px;
            background-color: #F0F0F0;
            vertical-align: middle;
        }

        .menu-items.diag.m5d input[type='text'] {
            width: 174px;
        }

        .menu-items.diag.m5d input,
        .menu-items.diag.m5d span.title {
            float: right;
        }

        .menu-items.diag.m5d input[type='button'],
        .menu-items.diag.m6 input[type='button'] {
            border-radius: 5px;
            color: #fff;
            background-color: #389C9E;
            cursor: pointer;
            float: right;
            height: 24px;
            box-shadow: 1px 1px 1px 0 #498383;
            padding: 2px 8px;
        }

        .menu-items.diag.m5d input[type='button']:hover,
        .menu-items.diag.m6 input[type='button']:hover {
            opacity: 0.8;
        }

        .menu-items.diag.m6 input[type='text'] {
            width: 110px;
        }

        .menu-items.diag.m5d .close,
        .menu-items.diag.m6 .close {
            position: absolute;
            width: 15px;
            height: 15px;
